import React from "react";
import { Switch, Router, Route, Link } from "react-router-dom";

// import Navbar from "./components/nav/Navbar.js";
import Home from "./components/test/Home.js";

const App = () => {
  return (
    <div>
      <Router>
        <div>
          <Switch>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>
    </div>
  );
};

export default App;
